import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router-dom';

// Other imports...

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <Link to="/destination">Enter Your Destination</Link>
          <Link to="/report">Report Time</Link>
          <Link to="/weather">Weather Today</Link>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/destination">
            <Destination />
          </Route>
          <Route path="/report">
            <Report />
          </Route>
          <Route path="/weather">
            <Weather />
          </Route>
          {/* Add other routes here */}
        </Switch>
      </div>
    </Router>
  );
}

// Define the components for each page
function Destination() {
  return <h2>Destination Page</h2>;
  // Add your destination page content here
}

function Report() {
  return <h2>Report Page</h2>;
  // Add your report page content here
}

function Weather() {
  return <h2>Weather Page</h2>;
  // Add your weather page content here
}

export default App;
